import Link from 'next/link';

const linkStyle = {
    margin: 50,
    fontSize: 50
  };
 
const barStyle = {
    padding: '0 10vh',
    textAlign: 'center'
}

  const Navbar = () => (
    <div style={barStyle}>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link>
    </div>
    
  );
  
  export default Navbar;
